import './App.css';
import { useState } from 'react';

function App() {

  const [macro, setMacro] = useState({
    Date: '',
    Calories: '',
    Protien: '',
    Carbs: '',
    Fat: ''
  })

  //const handleInput = (e) => {
   // e.persisit();
    //set
  //}

  return (

    <div className="App">
      <h1>Macro Logger Page</h1>
      <div className="MacroLog">

        <input type="date" id="start" name="Macro-Data" value="2018-07-22" min="2018-01-01" max="2018-12-31" />

        <input type="number" id="cal" placeholder="Calories (in grams)" min="0" max="100000" />

        <input type="number" id="protien" placeholder="Protien (in grams)" min="0" max="10000" />

        <input type="number" id="carb" placeholder="Carbs (in grams)" min="0" max="10000" />

        <input type="number" id="fat" placeholder="Fat (in grams)" min="0" max="10000" />

      </div>

    </div>
  );
}

export default App;
